class Game extends Component {

  render() {
    return (
      <div>

        <Container>
          <Row>
              <Col size="md-3">
                <DuncanIdaho/>
              </Col>
              <Col size="md-6"></Col>
              <Col size="md-3">
                <SardaukarElite/>                
              </Col>
            </Row>

              <BattleMenu

              />

        </Container>
      </div>
    );
  }
}

export default Game;
